import React from "react"
import s from "./App.css"
import Elem from "./ElementList"
import Input from "./Input"

function App(props) {
    return (
        <div className={s.content}>
            <div>
                <Elem state={props.state}/>
            </div>
            <div>
                <Input add={props.add}/>
            </div>
        </div>
    );
}

export default App;
